('sr', '_template', 'atutor_accessibility_text', '<p>ATutor ima u sebi razne osobine koje su oblikovane da bi sadržaj bio pristupačan  svim korisnicima, uključujući i one sa sporom Internet konekcijom, starijim web pretraživačima, kao i ljudima sa invaliditetom koji koriste asistivne tehnologije da  bi pristupili webu. Ove osobine su niže detaljno opisane. Ovisno o temi koja se koristi ATutor može da uključi sve ili samo neke od ovde navedenih osobina.  Podrazumevana tema uključuje sve osobine. </p> <ol> <li><strong>Preskoči Linkovi:</strong> U gornjem levom uglu ATutora je sakriveni link za preskakanje koji dozvoljava korisnicima asistivnih tehnologija da preskoče navigacione elemente i direktno skoče na   sidro na vrhu prikazanog sadržaja.  Pritisnite Tab taster kad se strana učita i tako pređite na prvi link za preskok  i kad pritisnete Enter tada će se sadržaj pozicionirati na vrh vašeg ekrana.  Sidru sadržaja može da se pristupi i pristupnim tasterom [Alt-c],  tako da je moguće skočiti na vrh područja sadržaja bez obzira gde se kursor nalazi na ekranu.<br /><br /> Drugi linkovi za preskok uključuju: \"skoči iza tabele\" tako da korisnici mogu da preskoče razne tabele sa podacima i da pređu na sadržaj koji se nalazi nakon tabele; \"skoči iza koda\", tako da korisnici mogu da preskoče preko koda za emotikon blizu dna polja za slanje poruka u Forumima. <br /><br /></li> <li><strong>Pristupni tasteri:</strong> Pristupačnost preko tastature je dodata mnogim osobinama ATutora. Da bi aktivirali pristupne tastere pritisnite Alt i dodeljeni broj, slovo ili znak.  Pristupni tasteri su dodeljeni dinamički tabovima u Glavnoj Navigaciji.  Prvi tab je dodeljen  [Alt-1], drugi tab je dodeljen [Alt-2], itd. Obratitepažnju na to da pristupne tastere ne podržavaju svi browseri.<br /><br /> Osnovni Pristupni Tasteri <ul> <li>[Alt-1 do Alt-0] Glavni Navigacioni Tabovi</li> <li>[Alt-,] Prethodna tema (i.e. Leva ugaona zagrada <)</li> <li>[Alt-.] Sledeća tema ( Desna ugaona zagrada > )</li> <li>[Alt-.] Sažetak ( Desna ugaona zagrada > dok smo izvan sadržaja)</li> <li>[Alt-j] Skoči na Meni</li> <li>[Alt-s] Podnesi (aktivan na mnogim stranama obrazaca)</li> <li>[Alt-c] Skoči na vrh sadržaja (gornji i navigacioni link za preskok)</li> </ul> Pristupni tasteri za Editor Sadržaja<ul> <li>[Alt-n] Sadržaj Tab</li> <li>[Alt-p] Svojstva Tab</li> <li>[Alt-g] Rečnik Tab</li> <li>[Alt-r] Prikaz Tab</li> <li>[Alt-a] Pristupačnost Tab</li> <li>[Alt-s] Sačuvaj</li> </ul> Pristupni tasteri za Ćaskanje <ul> <li>[Alt-c] Skoči na Sastavi poruku polje</li> <li>[Alt-r] Osveži poruke</li> <li>[Alt-m] Skoči na listu poruka</li> <li>[Alt-q] Završi Ćaskanje</li> </ul> Inbox Pristupni tasteri <ul> <li>[Alt-r] Odgovori na Poruke</li> </ul> <br />Pristupni Tasteri za Vizuelni Editor<ul> <li>[Alt-q] skoči na traku sa dugmićima</li> <li>[Alt-z] skoči na područje za sadržaj u editoru</li> <li>[Alt-x] skoči na putanju elemenata (dno)</li> </ul> </li> <li><strong>Verifikator Pristupačnosti: </strong>Za vreme upotrebe ATutor Editora Sadržaja, instruktori mogu da provere pristupačnost njihovog sadržaja da bi bili sigurni da sadržaju može da se pristupi od strane svih studenata, uključujući i one koji koriste asistivne tehnologije ili starije tehnologije.  Dok koristite Editor Sadržaja, odaberite [Alt-a]  da odaberete verifikator pristupačnosti.</li> <li><strong>Alternativni Tekst: </strong>Sve značajne slike u ATutoru uključujući alternativni tekst koji opisuje  sliku ili njenu funkciju.  Tamo gde slike nisu značajne Alt atribut je ostavljen prazan tako da asistivne tehnologije ignorišu sliku.</li> <li><strong>Alternativna Navigacija: </strong>Alati za globalnu, hijerarhijsku i sekvencijalnu navigaciju su raspoloživi tako da korisnici mogu da vide ili strukturiraju sadržaj na način koji zadovoljava njihov stil učenja. ATutor Mapa Sajta prikazuje punu listu celog sadržaja i raspoloživih alata, tako da svi delovi u kursu mogu da budu dostupni sa jednog mesta.</li> <li><strong>Prekini/Nastavi: </strong>ATutor pamti poslednju stranu kojoj je korisnik prišao pre napuštanja sadržaja kursa,  da bi npr. išao na Forum,  tako da može brzo da nađe put do strane koju je prethodno napustio. Lokacija sadržaja je zapamćena između sesija, tako da prilikom povratka u ATutor, korisnik može odabrati Sažetak link u listingu kursa na Moji Kursevi ili odabrati sažetak link u - mrvicama hleba- na vrhu ekrana dok je u kursu. Upotreba [Alt-.] pristupnog tastera će vratiti korisnika na poslednju stranu sadržaja koju je gledao nakon ulaska u kurs..</li> <li><strong>Sakrij Menije:</strong> Korisnici koji koriste starije asistivne tehnologije koje ne podržavaju tekst postavljen u kolumnama unutar tabela, mogu da sakriju Atutorov meni za navigaciju sadržajem tako da se sadržaj predstavi linearno. Sakrivanjem menija za sadržaj ostavlja se više prostora da korisnici vide ATutor na mannjim ekranima.</li> <li><strong>Pretraga i Sortiranje:</strong> Večina tabela podataka ima alat za pretragu, ili filter, tako da specifični unosi mogu da se prikažu u tabeli, smanjujući količinu podataka prikazanih u datom trenutku.  Večina tabela podataka mogu da se sortiraju odabiranjem naziva-etikete zaglavlja kolone, omogućavajuči korisnicima da suze prikaz podataka.</li> <li><strong>Asocijacije Zaglavlja Tabele: </strong>Sve tabele sa podacima su markirane sa TH elementom i opsegom atributa da bi se obezbedilo da korisnici čitača ekrana  mogu da prolaze kroz podatke i da prikaz omogućava razumevanje šta ćelija svakog podatka predstavlja.</li> <li><strong>Etikete Obrazaca: </strong>Sva polja u obrascima u ATutoru su markirana koristeći LABEL element da bi bili sigurni da su na odgovarajući način opisani za korisnike asistivnih tehnologija. Eksplicitno etiketiranje na ovaj način takođe omogućava da se klikne na etiketu da bi se aktiviralo polje. Ovo omogućava veće ciljno područje za one koji imaju poteškoće u pozicioniranju pokazivač miša na malo polje u obrascu kao što je radio dugme ili kutija za označavanje.</li> <li><strong>Strane Stila: </strong>Gde god je moguće, prezentacija sadržaja u  ATutor je kontrolisana elemntima strana stila. Ovo omogućava korisnicima da prevaziđu ATutorov pretpostavljeni način pokazivanja i primene vlastite  stilove predstavljanja ( povećana veličina slova, različiti stilovi slova, boja i sl.)</li> <li><strong>Fokus na Polje Obrasca: </strong> Na stranama gde ej primaran sadržaj obrazac, kursor će automatski da bude postavljen na prvo polje tako d anakon što se ta strana učita, korisnici mogu da odmah počnu da ispunjavaju polja u obrascu. Korisnici mogu da isključe fokus u svojim preferisanim podešavanjima ako taj fokus interferira sa njihovim ekranima za obrasce.</li> <li><strong>Relativne Veličine Slika: </strong>U browserima koji podržavaju menjanje dimenzija slika, ATutor slike  mogu biti uvećane za slabovide korisnike, i tako d aih učini lakše vidljivim. (npr. u Netscape 7 pritisnite Alt +) . Gde god je bilo moguće relativne veličine su korišćene za druge osobine u ATutoru tako da kad se interfejs uvećava ili smanjuje, sve osobine menjanju veličine relativno u odnosu jedne prema drugoj zadržavajući simetriju ekrana.</li> </ol>', '2016-08-31 17:53:10', ''),
