('sr', '_template', 'atutor_is', '<strong><em>ATutor</em></strong> je Open Source Web-baziran <strong>LCMS</strong> dizajniran za pristupačnost i otvorenost. Administrator može brzo instalirati ili ažurirati ATutor u minuti, kreirati posebne teme i odrediti novi izgled ili proširiti opseg funkcija omogućavajući ili razvijajući nove module. Instruktori mogu brzo, jednostavno da sastave, zapakuju i redistribuiraju sadržaj za učenje i voditi kurseve u on-line režimu rada. Polaznici mogu da uče u adaptivnom okruženju za učenje.', '2016-08-31 18:10:44', ''),
('sr', '_template', 'atutor_links', '<p>Naučite više o <a href=\"http://atutor.ca/index.php\">ATutor</a>\r\npregledavanjem sledećih adresa:</p> <ul> <li><a\r\nhref=\"http://atutor.ca/forums/index.php\">Support Forums</a> - Post to the user\r\nforums</li> <li><a href=\"http://atutor.ca/services/index.php\">Support\r\nServices</a> - Ako vam je potrebna naša pomoć, možete je dobiti na adresi</li>\r\n<li><a href=\"http://atutor.ca/atutor/translate/index.php\">Translation</a> -\r\nPreuzmite paket za prevod, postanite prevodilac</li> <li><a\r\nhref=\"http://atutor.ca/services/licensing.php\">Licensing</a> - ATutor program\r\nje se može slobodno dobiti pod određenim uslovima</li> <li><a\r\nhref=\"http://atutor.ca/atutor/download.php\">Download ATutor</a> - Celokupan\r\nsistemski softver neophodan za pokretanje ATutora možete preuzeti odavde\r\n</li> </ul>', '2016-08-31 18:11:35', ''),
