('sr', '_template', 'old_module_notes', '<p> Neki stariji moduli, iako ne svi, trebaju biti ažurirani da bi radili u ATutoru 2.2 i novijim verzijama. Oni su na raspolaganju tako daoni koji žele da ih koriste mogu da ažuriraju programski kod što uglavnom podrazumeva zamenu funkcija mysql baze pdataka sa novim funkcijama baze podataka queryDB(). Više informacija oqueryDB() možete videti u \"documentation/developer/guidelines.html#querydb\">Developer Documentation</a>.Ponovo nam priložite module kad ih ažurirate u <a href=\"http://atutor.ca/atutor/modules/index.php\">ATutor Modules site</a>.Da bi dobili priznanja prilaganje tih modula je najbrži način da povećate brojpoena u ATutoru. </p><br /> <p>Uzmite ovaj filter da vidite sve ili samomodulekoji su testirani u raznim verzijama ATutora.</p>', '2016-09-02 03:53:21', ''),
