('sr', '_template', 'patcher_alter_modified_files', 'Izlistane datoteke su promenjene lokalno. Ako odaberete da nastavite, vaša lokalna datoteka će biti promenjena. Originalne datoteke će biti sačuvane pre izmene. Uzmite u obzir da izmena vašeg priloženog koda može poremetiti vaša podešavanja.', '2010-01-01 12:22:44', ''),
('sr', '_template', 'patcher_overwrite_modified_files', 'Izlistane datoteke su izmenjene lokalno. Ako odlučite da nastavite, zakrpa će biti iskopirana na vaš lokalni računar.  Morate da ručno spojite ovu datoteku sa vašom lokalnom kopijom.<br/>', '2010-01-01 12:23:47', ''),
