('sr', '_template', 'patcher_show_patch_files', 'Ispod je lista datoteka zakrpa iskopiranih na vaš računar.  Molimo vas da ručno spojite izmene između zakrpa datoteka i vaše lokalne kopije. <br/>', '2010-01-01 12:25:18', ''),
